                "qModelRichText": "<div class=\"rich-text\"><h1>May 2018</h1><p>In April, the Low Composite portfolio just managed to edge out the High Composite portfolio. The monthly returns for the S&amp;P/TSX Composite Index and the High and Low Composite Factor portfolios were 1.8%, 1.7% and 2.1%, respectively. The three best-performing factors this month were Low Yield, Low Return on Equity, and High Price to Earnings with returns of 3.3%, 3.1%, and 3.1%. We believe that investors will eventually be rewarded for the value in the High Composite Factor portfolio stocks. The combination of all factors to create the composite portfolio often produces returns for the composite that are higher than any of the individual factors. The High Composite Factor portfolio benefits by selecting stocks that have scored well in all of the six factors.<br/></p></div>",
